import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};

const PostLink = props => (
  <li>
    <Link href={`/post?title=${props.title}`}>
      <a>{props.title}</a>
    </Link>
  </li>
);
const Header = () => (
  <div>
    <PostLink title="Hello Next.js" />
    <PostLink title="Learn Next.js" />
  </div>
);

export default Header;
